function switchOutImg(imageId, matchSrc, matchTitle, newSrc, newTitle) {

    if(img && img.title == matchTitle) { img.src = newSrc; img.title = newTitle; }

function showContentCheckImage(contentDivId, show, imageId, matchSrc, matchTitle, newSrc, newTitle) {
    var div = document.getElementById(contentDivId);

    if(imageId) switchOutImg(imageId, matchSrc, matchTitle, newSrc, newTitle);
}
function showContent(contentDivId, show, imageId, showSrc, hideSrc, showTitle, hideTitle) {
    var div = document.getElementById(contentDivId);
    div.style.display = show ? 'block' : 'none';
    if(imageId) {
    	var img = document.getElementById(imageId);
    	img.src = show ? showSrc : hideSrc;
    	img.title = show ? showTitle : hideTitle;
    }
}
function toggleContent(contentDivId, imageId, hideSrc, showSrc, hideTitle, showTitle) {
    var div = document.getElementById(contentDivId);
    var show = (div.style.display == 'none');
    showContent(contentDivId, show, imageId, hideSrc, showSrc, hideTitle, showTitle);
    return show;
}</script>
